import React, { useContext } from "react";
import "./Dashboard.css";

import CreateProposal from "./CreateProposal/CreateProposal";
import ExecuteProposal from "./ExecuteProposal/ExecuteProposal";
import TransferShares from "./TransferShares/TransferShares";
import RedeemShares from "./RedeemShares/RedeemShares";
import { ComponentContext } from "../../ComponentContext/ComponentContext";

const Dashboard = () => {
  const { setComponent } = useContext(ComponentContext);
  console.log(value.component);

  return (
    <div>
      <aside>
        <div onClick={() => value.setComponent(<CreateProposal />)}>
          <p>Create Proposal</p>
        </div>
        <div onClick={() => value.setComponent(<ExecuteProposal />)}>
          <p>Execute Proposal</p>
        </div>
        <div onClick={() => value.setComponent(<TransferShares />)}>
          <p>Transfer Shares</p>
        </div>
        <div onClick={() => value.setComponent(<RedeemShares />)}>
          <p>Redeem Shares</p>
        </div>
      </aside>
    </div>
  );
};
export default Dashboard;
